    IFNULL(clien_ma.Pasar_Importe, 0) AS Pasar_Importe,
    IFNULL(clien_ma.Grupo_Sedro, 0) AS Grupo_Sedro,
    IFNULL(clien_ma.Genera_Factura_PDF,0) AS Genera_Factura_PDF,
    IFNULL(clien_ma.Email_Factura_PDF,'') as Email_Factura_PDF,
    IFNULL(convt_ma.Descripcion,'') as Condicion_Vta,
    IFNULL(repar_ma.Codigo,'') as Codigo_Reparto,
    IFNULL(trans_ma.Razon_Social,'') as Transporte,
    IFNULL(agcli_ma.Descripcion,'') as Agrupacion,
    ifnull(lista_ca.Descripcion,'') as Lista,
    case ifnull(clien_obs.Imprimir,0) when 1 then ifnull(clien_obs.obs,'') else '' end as Obs_Imprimir,
    case ifnull(clien_obs.Imprimir,0) when 0 then ifnull(clien_obs.obs,'') else '' end as Obs_No_Imprimir,
    (select ifnull(padron_reg_gral.CUIT,false) from padron_reg_gral where padron_reg_gral.cuit = clien_ma.Nro_Cuit) padron_reg_gral,
    (select ifnull(padron_reg_gral.Alicuota_Percepcion,0) from padron_reg_gral where padron_reg_gral.cuit = clien_ma.Nro_Cuit) Alicuota_Percepcion,
    ifnull(clien_cm.J_902,0) as CM_J902,
    ifnull(clien_ma.Id_Categoria_Ing_Br,0) as Id_Cat_Ing_Br,
    ifnull(cat_ing_br.Id_Provincia,0) as Id_Provincia_CatIngBr,
    ifnull(cat_ing_br.Porcentaje_Pcia,0) as Porcentaje_Pcia
  FROM Clien_Ma
    LEFT JOIN convt_ma ON clien_ma.Id_Condicion_Vta = convt_ma.Id
    LEFT JOIN repar_ma on clien_ma.Id_Reparto = repar_ma.Id
    LEFT JOIN trans_ma on clien_ma.Id_Transporte = trans_ma.Id
    left join agcli_ma on clien_ma.Id_Agrupacion = agcli_ma.Id
    left join lista_ca on clien_ma.Id_Lista_Precio = lista_ca.Id
    LEFT JOIN clien_obs on clien_ma.Id = clien_obs.Id_Cliente
    LEFT JOIN tipo_iva on clien_ma.Tipo_Iva = Tipo_Iva.Codigo_Iva
    LEFT JOIN Padron_Reg_Gral on clien_ma.Nro_Cuit = padron_reg_gral.CUIT
    LEFT JOIN clien_cm on clien_ma.id = clien_cm.Id_Cliente
    LEFT JOIN cat_ing_br on clien_ma.Id_Categoria_Ing_Br = cat_ing_br.id
  WHERE Clien_Ma.Id = `_ID`
        and clien_obs.Tipo = 'GEN'
        AND clien_ma.Provincia <> 23 and clien_ma.Provincia <> 25

