CREATE DEFINER=`root`@`localhost` PROCEDURE `Produ_Ma_Cons` ()  select
    CONCAT(substring(produ_frac.Codigo_producto,1,6), produ_frac.Codigo_Fraccio) AS Codigo_Producto,
    CONCAT(ltrim(rtrim(IfNull(Produ_Ma.Descripcion,''))),' ',ltrim(rtrim(IfNull(Produ_Frac.Descripcion,''))),ltrim(rtrim((IFNull(Fraccio_Ma.Detalle,'')))))  AS Descripcion_Producto,
    produ_frac.Ume_Vta,
    produ_frac.Minimo,
    rubro_ma.Descripcion as Rubro_Vta,
    lista_de.Precio
  from produ_frac
    inner join produ_ma on produ_frac.id_Producto = produ_ma.id
    inner join fraccio_ma on produ_frac.id_Fraccio = fraccio_ma.id
    inner join rubro_ma on produ_ma.id_Rubro_Vta = rubro_ma.Id
    inner join lista_de on produ_frac.id_Producto = lista_de.Id_Producto and produ_frac.id_Fraccio = lista_de.Id_Fraccio
  WHERE lista_de.Id_Lista_Ca = 2
  order by Descripcion_Producto

CREATE DEFINER=`root`@`localhost` PROCEDURE `Produ_Ma_Cons_Codigo` (IN `_Codigo_Producto` VARCHAR(9), IN `_Codigo_Fraccio` VARCHAR(3))  SELECT
    produ_frac.Id_Producto,
    produ_frac.Id_Fraccio,
    produ_frac.Ume_Vta,
    CONCAT(substring(produ_frac.Codigo_producto,1,6), produ_frac.Codigo_Fraccio) AS Codigo_Producto,
    CONCAT(CONCAT(IFNULL(trim(Produ_Ma.Descripcion), ''),' ',
                  IFNULL(trim(produ_frac.Descripcion), '')),' ',
           IFNULL(trim(fraccio_ma.Detalle), '')) AS Descripcion_Producto,
    produ_frac.Baja,
    
    ifnull(rubro_ma.Descripcion,'') Rubro_Vta,
    ifnull(rubro_ma.Color,0) Rubro_Color,
    IFNULL(uni_med.Unidad,'') AS UmeVta,
    case produ_frac.baja when 1 then 'BAJ' else 'CAR' end as Estado_PF,
    produ_frac.Minimo,
  
    
    ifnull(produ_ma.Tipo_Iva,'') Tipo_Iva,
    ifnull(produ_ma.Tipo_Ing_Brutos,0) Tipo_Ing_Brutos,
    ifnull(produ_ma.id_Moneda,1) id_Moneda,
    case when produ_ma.id_moneda <> 1 then produ_frac.Costo_MP else 0 end Costo_Moneda,
    case when produ_ma.id_moneda <> 1 then produ_frac.costo * lista_de.Porcentaje else 0 end Precio_Moneda,
    case when produ_ma.id_Moneda = 1 then produ_frac.Costo_MP else 0 end Costo_Pesos,
    case when produ_ma.id_moneda = 1 then produ_frac.costo * lista_de.Porcentaje else 0 end Precio_Pesos,
    ifnull((select moned_de.Valor_Moneda from moned_de where moned_de.id_moned_ca = produ_ma.id_moneda order by Fecha_Cotizacion desc LIMIT 1 ),1) Valor_Moneda,
    case when produ_frac.Habil_Cot = true then 1 else 0 end Habil_Cot,
    case when produ_frac.Habil_Ped = true then 1 else 0 end Habil_Ped,
    case when produ_frac.Habil_Pre = true then 1 else 0 end Habil_Pre
  FROM produ_ma inner join produ_frac on (produ_ma.id = produ_frac.id_Producto) INNER JOIN fraccio_ma on (produ_frac.id_Fraccio = fraccio_ma.id)
    left join uni_med on produ_ma.id_Ume_Vta = uni_med.id
    inner join rubro_ma on produ_ma.id_Rubro_Vta = rubro_ma.Id
    left join moned_de on produ_ma.id_Moneda = moned_de.id_Moned_Ca
    left join lista_de on produ_frac.id_Producto = lista_de.Id_Producto and produ_frac.id_Fraccio = lista_de.Id_Fraccio
  WHERE produ_frac.Codigo_producto = _Codigo_Producto
        AND produ_frac.Codigo_Fraccio = _Codigo_Fraccio
        AND lista_de.Id_Lista_Ca = 2

CREATE DEFINER=`root`@`localhost` PROCEDURE `Produ_Ma_Cons_CodigoProductoTodos` (IN `_CodigoProducto` VARCHAR(9))  SELECT
    IFNull(Produ_Frac.Id_Producto, 0) AS Id_Producto,
    IFNull(Produ_Frac.Id_Fraccio, 0) AS Id_Fraccio,
    CONCAT(substring(produ_frac.Codigo_producto,1,6), produ_frac.Codigo_Fraccio) AS Codigo_Producto,
    CONCAT(ltrim(rtrim(IfNull(Produ_Ma.Descripcion,''))),' ',ltrim(rtrim(IfNull(Produ_Frac.Descripcion,''))),ltrim(rtrim((IFNull(Fraccio_Ma.Detalle,'')))))  AS Descripcion_Producto

  FROM produ_ma
    inner join produ_frac on (produ_ma.id = produ_frac.id_Producto)
    INNER JOIN fraccio_ma on (produ_frac.id_Fraccio = fraccio_ma.id)
    left join lista_de on produ_frac.id_Producto = lista_de.Id_Producto and produ_frac.id_Fraccio = lista_de.Id_Fraccio
  WHERE produ_ma.Codigo_Producto LIKE CONCAT('%',_CodigoProducto,'/000')
        AND lista_de.Id_Lista_Ca = 2

CREATE DEFINER=`root`@`localhost` PROCEDURE `Produ_Ma_Cons_Descri` (IN `_Descripcion` VARCHAR(50))  SELECT
    IFNull(Produ_Frac.Id_Producto, 0) AS Id_Producto,
    IFNull(Produ_Frac.Id_Fraccio, 0) AS Id_Fraccio,
    CONCAT(substring(produ_frac.Codigo_producto,1,6), produ_frac.Codigo_Fraccio) AS Codigo_Producto,
    CONCAT(ltrim(rtrim(IfNull(Produ_Ma.Descripcion,''))),' ',ltrim(rtrim(IfNull(Produ_Frac.Descripcion,''))),ltrim(rtrim((IFNull(Fraccio_Ma.Detalle,'')))))  AS Descripcion_Producto

  FROM produ_ma
    inner join produ_frac on (produ_ma.id = produ_frac.id_Producto)
    INNER JOIN fraccio_ma on (produ_frac.id_Fraccio = fraccio_ma.id)
    left join lista_de on produ_frac.id_Producto = lista_de.Id_Producto and produ_frac.id_Fraccio = lista_de.Id_Fraccio
  WHERE produ_ma.descripcion like CONCAT('%',_Descripcion,'%')
        AND lista_de.Id_Lista_Ca = 2

DELIMITER ;

